interface Project {
  id: string;
  name: string;
  userId: string;
  repoUrl: string;
}

export class ApiClient {
  private baseUrl: string;

  constructor(baseUrl: string) {
    this.baseUrl = baseUrl;
  }

  async fetchProjects(): Promise<Project[]> {
    const response = await fetch(`${this.baseUrl}/projects`);
    return response.json();
  }
}

